  phonebookListResultHandler(msgObj) {
    let {Contacts, Offset, Limit} = msgObj.PhonebookListResult;
    this.phonebook = Contacts.reduce((phonebook,entry)=>{
      phonebook[this.makePhonebookLabel(entry)] = entry;
      return phonebook;
    }, this.phonebook);

    if (Contacts.length == Limit) {
      this.base.performInPriority('getPhonebook', {Offset: Offset+Limit, Limit});
    } else {
      let contactList = _.isEmpty(this.phonebook) ? 
        [NO_CONTACT] : 
        Object.keys(this.phonebook)
          .filter(k=> this.phonebook[k].isZoomRoom)
          .sort(sortCapitalized)
          .concat(
            Object.keys(this.phonebook)
              .filter(k=> !this.phonebook[k].isZoomRoom)
              .sort(sortCapitalized));
      
      this.updateVarEnums(this.base.getVar('AddressBook'), contactList);
    } 
  }

